			numFilter(value) {
				// 截取当前数据到小数点后两位
				let realVal = parseFloat(value).toFixed(3)
				return realVal
			},
			// 获取状态列表
			getStusedList(code) {
				statusedList(code).then(res => {
					console.log(res, "前接口数据")
					this.statudList = res.data
					this.statudList.map(item => {
						switch (item.subtype) {
							case 0:
							case 6:
							case 7:
								item.showType = 'table';
								break;
							case 5:
								item.showType = 'oil';
								break;
							case 0:
