								break;
								case 1:
									item.showType = 'pie';
									break;
							default:
								item.showType = 'pie';
								break;
						}
					})
				})
			},
			// 表格数据
			getDevicelistData(code) {
				DevicelistData(code).then(res => {
					// console.log(res,3330)
					let data = res.data.points
					// console.log(data, "后接口数据")
					this.statudListed = this.statudList.map((item, index) => {
						data.map(each => {
							if (item.code === each.point) {
								item.acc_state = each.acc_state //加速度的状态
								item.vel_state = each.vel_state //速度的状态
								item.dis_state = each.dis_state //位移的状态
								item.env_state = each.env_state //包络的状态
								item.temp_state = each.temp_state //温度的状态
								item.state = each.state
								this.$forceUpdate()
							}
							if (item.code === each.point) {
								item.acc = each.acc //加速度
								item.vel = each.vel //速度
								item.dis = each.dis //位移
								item.env = each.env //包络
								item.temp = each.temp //温度
								item.time = each.time //时间
								item.speed = each.speed //转速
								item.alarmCode =each.alarmCode
								item.alarmCode =JSON.parse(JSON.stringify(each.alarmCode))
								this.$forceUpdate()
								return
							}
						})
						if (item.subtype == 8 || item.subtype == 0 || item.subtype == 1) {
							this.showGauge0('canvasGauge' + index, this.statudList[index], index)
						}
					})
				})
